{"id":"13kk2","title":"untitled-c048ac","value":"import DiodeFilter from '/dsp/diodefilter/index.js'
import Wavetable from '/dsp/wavetable-osc/index.js'
import stereoify from '/dsp/stereoify.js'
import sequence from '/dsp/sequence.js'
import slide from '/dsp/slide.js'
import note from '/dsp/note/index.js'
import clip from '/dsp/softclip/index.js'
import arp from '/dsp/arp.js'

export const channels = 2
export const bars = 4

const Melody = [7,4,8].map(n => note(n+15))

export default async (context) => {
  const bass = await Bass(context)

  return mix => mix(
    t => t/4 < 2 
      ? bass(t, { cut: 0.092 })*.7 
      : bass(t, { cut: 0.072 })*.75,
    t => stereoify(t)
  )
}

export const Bass = (context, { 
  res = 0.88, 
  hpf = .003, 
  melody = Melody 
} = {}) => {
  var filter = new DiodeFilter()

  var osc = Wavetable(context, 'saw', 1024);
  var lfo = Wavetable(context, 'sin', 512);
  var lfo2 = Wavetable(context, 'sin', 512);

  return (t, { cut = 0.072, res = 0.68, hpf = .00009 } = {}) => {
    filter.res(res)
    filter.hpf(hpf)
    filter.cut(cut + lfo(1.33)*.0055)
    // ((lfo(1) * .6 + 1.2) / 2) 
  // * (0.370 + lfo2(.02) * 0.04))

    var n = slide(t, 1/8, 2, melody)

    var synth_osc = osc(n)
    var synth = arp(t+.6, 1/2, synth_osc, 3, 2.15)

    synth = filter.run(synth * .6)
    synth = clip(synth * 5)

    return 0.5 * synth
  }
}
